    IclightV2OutputFormat: typing.ClassVar[type] = nodetool.nodes.fal.image_to_image.IclightV2OutputFormat

    initial_latent: nodetool.nodes.fal.image_to_image.IclightV2InitialLatent = Field(default=nodetool.nodes.fal.image_to_image.IclightV2InitialLatent.NONE, description='Provide lighting conditions for the model')
    prompt: str | OutputHandle[str] = connect_field(default='', description='The prompt to generate an image from.')
    image_size: str | OutputHandle[str] = connect_field(default='', description='The size of the generated image.')
    background_threshold: float | OutputHandle[float] = connect_field(default=0.67, description='Threshold for the background removal algorithm. A high threshold will produce sharper masks. Note: This parameter is currently deprecated and has no effect on the output.')
    mask_image: types.ImageRef | OutputHandle[types.ImageRef] = connect_field(default=types.ImageRef(type='image', uri='', asset_id=None, data=None, metadata=None), description='URL of mask to be used for ic-light conditioning image')
    guidance_scale: float | OutputHandle[float] = connect_field(default=5, description='The CFG (Classifier Free Guidance) scale is a measure of how close you want the model to stick to your prompt when looking for a related image to show you.')
    lowres_denoise: float | OutputHandle[float] = connect_field(default=0.98, description='Strength for low-resolution pass.')
    enable_safety_checker: bool | OutputHandle[bool] = connect_field(default=True, description='If set to true, the safety checker will be enabled.')
    negative_prompt: str | OutputHandle[str] = connect_field(default='', description='Negative Prompt for the image')
    num_images: int | OutputHandle[int] = connect_field(default=1, description='The number of images to generate.')
    output_format: nodetool.nodes.fal.image_to_image.IclightV2OutputFormat = Field(default=nodetool.nodes.fal.image_to_image.IclightV2OutputFormat.JPEG, description='The format of the generated image.')
